import React from 'react';
import './Podcast.css';

const Podcast = () => {
    return (
        <div>
            <div className='w-100 mx-auto podcast-style'>
                <div>
                    <h1> <span className='sp1'>Po</span><span className=''>dc</span><span>a</span><span>st</span></h1>
                    <div className="card text-bg-dark w-50 mx-auto my-5 v-style shadow-lg">
                        <video className='v-style' controls src="video/podcast first part.mp4"></video>
                        <div className="card-video-overlay">
                            <h6 className="card-title">Podcast with Jhankar Mahbub</h6>
                            <p className="card-text">CEO of programming hero ltd and Bangladesh number one web developer</p>
                            <p className="card-text"><small>First part</small></p>
                        </div>
                    </div>
                    <div className="card text-bg-dark w-50 mx-auto mb-5 v-style shadow-lg">
                        <video className='v-style' controls src="video/podcast part two.mp4"></video>
                        <div className="card-video-overlay">
                            <h6 className="card-title">Podcast with Jhankar Mahbub</h6>
                            <p className="card-text">CEO of programming hero ltd and Bangladesh number one web developer</p>
                            <p className="card-text"><small>First two</small></p>
                        </div>
                    </div>
                </div>
            </div>

        </div>
    );
};

export default Podcast;
